 

CREATE TABLE ITS_MOEDA (
  IdMoeda INT IDENTITY
 ,NomeMoeda VARCHAR(500) COLLATE Latin1_General_CI_AS NOT NULL
 ,CodigoWSCompra BIGINT NOT NULL
 ,CodigoWSVenda BIGINT NOT NULL
 ,CONSTRAINT [PK_ITS_COD_MOEDA_BACEN] PRIMARY KEY CLUSTERED (IdMoeda)
) ON [PRIMARY]


CREATE TABLE ITS_COTACAO_MONETARIA (
  IdCotacaoMonetaria INT IDENTITY
 ,DataCotacao DATETIME NOT NULL
 ,ValorCompra DECIMAL(18, 4) NOT NULL
 ,ValorVenda DECIMAL(18, 4) NOT NULL
 ,IdMoeda INT NOT NULL
 ,CONSTRAINT [PK_ITS_COTACAO_MONETARIA] PRIMARY KEY CLUSTERED (IdCotacaoMonetaria)
 ,CONSTRAINT [FK_ITS_COTACAO_MONETARIA_dbo_IdMoeda] FOREIGN KEY (IdMoeda) REFERENCES ITS_MOEDA (IdMoeda) ON DELETE CASCADE
) ON [PRIMARY]
GO
CREATE INDEX IX_IdMoeda
ON ITS_COTACAO_MONETARIA (IdMoeda)
ON [PRIMARY]
GO

